import enGbDatePicker from 'date-fns/locale/en-GB';
var date = {
  day: 'numeric',
  month: 'short',
  year: 'numeric'
};
var time = {
  hourCycle: 'h12',
  hour: 'numeric',
  minute: '2-digit'
};
var enUS = {
  dateOptions: {
    locale: 'en-us',
    date: date,
    time: time
  },
  datepicker: enGbDatePicker,
  // Yes, this is GB.
  collapse: 'Collapse',
  expand: 'Expand',
  colorTheme: 'Color theme',
  dark: 'Dark',
  light: 'Light',
  system: 'System',
  closeMessage: 'Close message',
